{"operationName":"RecentlyAddedRepAssetLibrary","variables":{"first":8},"query":"query RecentlyAddedRepAssetLibrary($first: Int!) {
  repAssetLibrary {
    listRecentlyPublishedRepRefAssets(first: $first, after: {{endCursor}} ) {
      pageInfo {
        total
     endCursor
 }
      edges {
        node {
          id
      mobileUrl
      name
          description
          sharingType
          updatedOn
          publishedOn
          lastViewedOn
          expiry
          fileType
           stats {
            rating
            downloads
            views
            totalViews
            bookmarked
            ratingCount
          }
          interaction {
            isBookmarked
          }
          hubs(first: 10) {
            pageInfo {
              total
            }
            edges {
              node {
                name
              }
            }
          }
          file {
            ... on File {
              id
              media {
                ... on AudioMedia {
                  mediaType
                  thumb
                  contentParts: audioLength
                }
                ... on VideoMedia {
                  mediaType
                  thumb
                  contentParts: videoLength
                }
                ... on DocMedia {
                  mediaType
                  thumb
                  contentParts: totalPages
                }
                ... on ImageMedia {
                  mediaType
                  thumb
                  contentParts: size
                }
                ... on LinkMedia {
                  mediaType
                  thumb
                }
                ... on DocMediaPage {
                  mediaType
                  thumb
                }
              }
            }
          }
        }
      }
    }
  }
}
"}
